const tbody = document.querySelector('tbody');

const createRow = (p) => {
    const tr = document.createElement('tr');

    const tdId = document.createElement('td');
    tdId.innerText = p.id;
    const tdNom = document.createElement('td');
    tdNom.innerText = p.last_name;
    const tdPrenom = document.createElement('td');
    tdPrenom.innerText = p.first_name;
    const tdEmail = document.createElement('td');
    tdEmail.innerText = p.email;
    const tdBd = document.createElement('td');
    tdBd.innerText = p.birthdate;
    tr.append(tdId, tdNom, tdPrenom, tdEmail, tdBd)
    return tr;
}

tbody.append(...data.map(p => createRow(p)));

